Yes, MAT is good, standalone version is recommended. I usually use the following wrapper:
#!/bin/ksh MAT_HOME=/local/share/mat if [ -z "$JDK" ]; then . ${INFO_DIR}/$OSTYPE/jdk16.sh fi MATSPACE=${MATSPACE:-${HOME}/mat} echo "Starting Ecplise Memory Analyzer Tool. Please wait ..." # cd ${MAT_HOME} #java -jar plugins/org.eclipse.equinox.launcher_*.jar >/dev/null 2>&1 & ${MAT_HOME}/MemoryAnalyzer.`uname -p` -vmargs -Xmx2048m -data ${MATSPACE} >/dev/null 2>&1 &
